import style from './css/masonry.module.css';
import { Link } from 'react-router-dom';

const Masonry = (props) => {
    return (
        <div className={style.masonry}>
            <p>{props.title}</p>
            <Link to="" title="Profesi Dukun Beranak, Mencoba Bertahan dari Terpaan Zaman">
                <img src="https://video-images.vice.com/articles/608bdda9702301009ee5efeb/lede/1619786084638-dukun-bayi-15.jpeg?crop=1xw:0.8425xh;0xw,0.0048xh&resize=442:*" alt="Profesi Dukun Beranak, Mencoba Bertahan dari Terpaan Zaman" />
            </Link>
            <h2>
                <Link to="" title="Profesi Dukun Beranak, Mencoba Bertahan dari Terpaan Zaman">Profesi Dukun Beranak, Mencoba Bertahan dari Terpaan Zaman</Link>
            </h2>
            <p>Kombinasi maraknya bidan, RS bersalin, serta aturan pemerintah membuat paraji makin langka. Seri foto ini merekam para dukun yang punya peran tak tergantikan di daerah terpencil.</p>
        </div>
    )
}

export default Masonry;
